import Stack from '@material-ui/core/Stack';
import Box from '@material-ui/core/Box';
import { styled } from '@material-ui/core/styles';
import useWindowDimensions from '../../components/ui/Window.js';
import theme from "../../components/ui/Theme.js";
import { Parallax } from 'react-parallax';

import brot1 from '../../resource/images/brot1.png';
import brot2 from '../../resource/images/brot2.png';
import brot3 from '../../resource/images/brot3.png';
import brot4 from '../../resource/images/brot4.png';
import brot5 from '../../resource/images/brot5.png';


const Section = styled(Box)(({ theme }) => ({
    width: `100%`,
    backgroundColor: theme.palette.success.main,
    backgroundImage: `url(${brot5})`,
    backgroundSize: `auto 100%`,
    backgroundPosition: `center`
}));

function MainPage() {
    const height = useWindowDimensions().height * 1.5;

    element.scrollIntoView({ behavior: "smooth", block: "end", inline: "nearest" });

    return (
        <Stack>

            <Parallax id="1" bgImage={brot1} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>
                <Section style={{ height: height }} sx={{ mt: height / 8 }}> ASDF </Section>
            </Parallax>

            <Parallax id="2" bgImage={brot2} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>
                <Section style={{ height: height }} sx={{ mt: height / 8 }} />
            </Parallax>

            <Parallax id="3" bgImage={brot3} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>
                <Section style={{ height: height }} sx={{ mt: height / 8 }} />
            </Parallax>

            <Parallax id="4" bgImage={brot4} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>
                <Section style={{ height: height }} sx={{ mt: height / 8 }} />
            </Parallax>

        </Stack>
    )
}

export default MainPage;
